
use travel_planner;

create table tb_accommodations (cost float(53), check_in datetime(6) not null, check_out datetime(6) not null, created_at datetime(6) not null, id bigint not null auto_increment, trip_id bigint, updated_at datetime(6) not null, address varchar(255), name varchar(255) not null, type varchar(255), primary key (id)) engine=InnoDB;
create table tb_activities (cost float(53), created_at datetime(6) not null, date datetime(6) not null, id bigint not null auto_increment, trip_id bigint, updated_at datetime(6) not null, location varchar(255) not null, name varchar(255) not null, primary key (id)) engine=InnoDB;
create table tb_destinations (rate integer, created_at datetime(6) not null, id bigint not null auto_increment, updated_at datetime(6) not null, description varchar(255), image_url varchar(255), name varchar(255), primary key (id)) engine=InnoDB;
create table tb_flights (cost float(53) not null, start_date date not null, created_at datetime(6) not null, id bigint not null auto_increment, trip_id bigint, updated_at datetime(6) not null, airline varchar(255) not null, arrival varchar(255) not null, departure varchar(255) not null, transit varchar(255) not null, primary key (id)) engine=InnoDB;
create table tb_image_data (id bigint not null auto_increment, name varchar(255), type varchar(255), image_data LONGBLOB, primary key (id)) engine=InnoDB;
create table tb_notifications (created_at datetime(6) not null, id bigint not null auto_increment, trip_id bigint, updated_at datetime(6) not null, message text, type varchar(255), primary key (id)) engine=InnoDB;
create table tb_reviews (rating integer not null, accommodation_id bigint, created_at datetime(6) not null, id bigint not null auto_increment, updated_at datetime(6) not null, user_id bigint, comment text not null, primary key (id)) engine=InnoDB;
create table tb_sharedtrips (created_at datetime(6) not null, id bigint not null auto_increment, shared_date datetime(6), shared_user_trip bigint, trip_id bigint, updated_at datetime(6) not null, primary key (id)) engine=InnoDB;
create table tb_trips (end_date date not null, is_public bit, start_date date not null, created_at datetime(6) not null, destination_id bigint not null, id bigint not null auto_increment, updated_at datetime(6) not null, user_id bigint, title varchar(255) not null, primary key (id)) engine=InnoDB;
create table tb_users (is_deleted bit, created_at datetime(6) not null, id bigint not null auto_increment, updated_at datetime(6) not null, email varchar(255) not null, full_name varchar(255), password varchar(255) not null, preferences varchar(255), profile_picture varchar(255), role varchar(255) not null, username varchar(255) not null, primary key (id)) engine=InnoDB;
